import React from 'react';
import Image from './Image';
import profilePic from "../assets/Images/pexels-photo-220453.jpeg";
import Button from './Button';

export default function ProfileLeft(props) {
    return (
      <div className={props.class}>
        <Image
          src={profilePic}
          alt="profile picture"
          height="300px"
          width="300px"
        />
        <div>
          <Button value="Basic details" />
          <br />
          <Button value="Recently viewed" />
          <br />
          <Button value="My blog posts" />
          <br />
          <Button value="Favourite items" />
          <br />
          <Button value="Bookmarked posts" />
        </div>
      </div>
    );
}
